import React from 'react';
import Header from './pages/Header';
import MainEvent from './pages/MainEvent';
import Main from './pages/Main';
import BREvent from './pages/BREvent';

function App() {
  return (
    <div>
      <Header/>
      <MainEvent/>
      <Main/>
      <BREvent/>

    </div>
  );
}

export default App;
